import React, { Component } from 'react'

class massage extends Component {
    constructor(){
        super()
        this.state = {
            massage: 'welcome visitor'
        }
    }
    render() {
        return (
            <div>
                <h1>{this.state.massage}</h1>
                <button>subscribe</button>
            </div>
        )
    }
}

export default massage
